function obrazek(){
(!session_start())?session_start():NULL;
//session_register("captha");
$width = 160;
$height = 50;
$x = 10;
$y = 16;
$size = imageloadfont('data:application/octet-stream;base64,');
$angle = 0;
$font_size = 5;
$text_width = imagefontwidth($font_size);
$text_height = imagefontheight($font_size);
putenv('GDFONTPATH=' . realpath('.'));
// Path to our ttf font file
//$font_file = 'Achafsex.ttf';

$my_image = imagecreatetruecolor($width, $height);
imagealphablending($my_image, false);
$bg = imagecolorallocatealpha($my_image, 0xFF, 0xFF, 0x00,1);
$text_color = imagecolorallocatealpha($my_image, 81, 44, 91,1);

$rand_string = rand(1000,9999);


imagefill($my_image, 0, 0, $bg);

imagestring($my_image, $size, $x, $y, $rand_string, $text_color);
imagesavealpha($my_image, true);
header("Content-type: image/PNG");
//setcookie('spr',(isset($_COOKIE['obr']))?$_COOKIE['obr']:NULL);
$_SESSION["captha"] = md5($rand_string);
setcookie("obr",md5($rand_string));
imagepng($my_image);
imagedestroy($my_image);
clearstatcache();
}
}
