// formularz
function label($label)
{
	if (isset($label)) {
	echo '<p><label for="'.$id.'">'.$label.'</label></p>';	
	} 	
}
function form($start='no',$id=NULL,$name=NULL)
{
	if ($start!='no' || $start=='yes') {
		echo '<form action="http://'.dirname($_SERVER['HTTP_HOST'].$_SERVER['SCRIPT_NAME']).''.$_SERVER['PATH_INFO'].'/" method="POST" accept-charset="utf-8" name="'.$name.'" id="'.$id.'">';
	} else {
		echo '</form>';
	}
		
}
function input($type,$name,$id,$label=NULL,$input_event=NULL) {

	if($type=="text")
	{
		label($label);
		echo '<p><input type="'.$type.'" name="'.$name.'" id="'.$id.'" value="'.$_REQUEST[$name].'"/></p>';
	} elseif($type=="email") {
		label($label);
		echo '<p><input type="text" name="'.$name.'" id="'.$id.'" value="'.$_REQUEST[$name].'" /></p>';
	} elseif ($type=="submit" || $type=="reset" || $type=="button") {
		echo '<p><input type="'.$type.'" name="'.$name.'" id="'.$id.'" value="'.$label.'" onclick="'.$input_event.'"/></p>';
		
	} elseif ($type=="area") {
		label($label);
        //echo ("<p><a href=\"javascript:;\" onmousedown=\"tinyMCE.get('$name').show();\">Show</a>");
        //echo ("<a href=\"javascript:;\" onmousedown=\"tinyMCE.get('$name').hide();\">Hide</a></p>");
		echo '<p><textarea name="'.$name.'" id="'.$id.'" >'.$_REQUEST[$name].'</textarea></p>';
	} elseif ($type=="obrazek") {
		$host = $_SERVER['HTTP_HOST'];
		$script = $_SERVER['SCRIPT_NAME'];
		$full = "http://".$host.$script;
		label($label);
		echo '<p><img src="'.dirname($full).'/obrazek.php" alt="ERROR!!!" class="kod" id="kod" title="Kod!" /></p>';
		echo '<p><input name="'.$name.'" type="text" id="'.$id.'" value="" /></p>';
	} else {
		return FALSE;
	}
}

// funkcja weryfikacji formularza
function valid($type,$name){
	if ($type=="text" || $type=="area") {
		// 	weryfikacja pola text
		$ciag_text = '/[a-zA-ZąćęłńóśźżĄĆĘŁŃÓŚŹŻ0-9\-\_\.\(\)\,\:\@\!\?\%]$/';
		$ftext = preg_match($ciag_text,$name);
		if (!empty($name)&&$ftext==TRUE){
			return true;
		} else {
			return false;
		} 
	} elseif ($type=="email") {
	//	weryfikacja pola email
		$ciag = '/[_a-z0-9-]+(\.[_a-z0-9-]+)*@[a-z0-9-]+(\.[a-z0-9-]+)*(\.[a-z]{2,6})$/';
		$fmail = preg_match($ciag, $name);
		if ($fmail) {
			return true;
		} else {
			return false;
		}
	} elseif ($type=="obrazek") {
		//	weryfikacja pola obrazka
		//@setcookie('spr',$_COOKIE['obr']);
		$ciag_num = '/[a-zA-Z0-9]{4}?/';
		$fnum = preg_match($ciag_num,strtoupper($name));
		
			if(md5(strtoupper($name)) == $_SESSION["captha"] /*$_COOKIE['obr']*/){
				$_SESSION["captha"] = '';				
				@setcookie('obr','');
				return true;
			} else {
				return false;
		}
    } else {
		return FALSE;
	}
}
// validacja pola
function input_valid($type,$name,$id,$label=NULL,$label_d=NULL,$label_z=NULL)
{
	if (!$_REQUEST[$name]&&!$_REQUEST['submit']) {
		input($type,$name,$id,$label);
	} else {	
		if (valid($type,$_REQUEST[$name])) {
		input($type,$name,$id,$label_d);
		} else {
		input($type,$name,$id,$label_z);
		}
	}	
}

